import axios from "axios";

const baseUrl = "http://localhost:5000";

const addBooks=async(book)=>{
    try{
        const response = await axios.post(`${baseUrl}/admin/save`,book)
        .then(({data})=>{
            console.log(data);
        })
        console.log(response.data);
    }
    catch(error){
         console.log(error);   
    }
}

export {addBooks}
